let myMap;

const init = () => {
    myMap = new ymaps.Map("map", {
        center: [55.643344, 37.744528],
        zoom: 15,
        controls: []
    });

    const coords = [
        [55.64180353134756, 37.745141740753134],
        [55.64357317994271, 37.73744352877173],
        [55.64896234819763, 37.74507361433981],
        [55.64985062283247, 37.76998777555326]
    ];

    const myCollection = new ymaps.GeoObjectCollection({}, {
        draggable: false,
        iconLayout: 'default#image',
        iconImageSize: [46, 57],
        iconImageOffset: [-35, -52],
        iconImageHref: "./images/icons/marker.svg",
    });

    coords.forEach(coord => {
        myCollection.add(new ymaps.Placemark(coord));
    });

    myMap.geoObjects.add(myCollection);

    myMap.behaviors.disable('scrollZoom');

};

ymaps.ready(init);


const form = document.querySelector(".form");
const modal = document.querySelector("#modal");
const modalText = modal.querySelector(".modal__text");
const modalCloseBtn = document.querySelector(".app-modal-close");
const reset = document.querySelector(".form__reset");
/**
 * Функция для покази или закрытия всплывающего модального окна
 */
const toggleModal = () => {
    if(modal.classList.contains("active")) {
        modal.classList.remove("active");
    } else {
        modal.classList.add("active");
    }

    // Убираем или добавлчем вертикальный скролл
    changeScroll();
};

/**
 * Обратотчик закрытия модального окна
 */
modalCloseBtn.addEventListener("click", (e) => {
    e.preventDefault();
    toggleModal();
});

/**
 * Функция валидации формы на пустые занчения
 * @param fields
 * @returns {boolean}
 */
const validateForm = (...fields) => {
    const emptyFields = fields.filter((item) => {
        // Убираем на поле класс для ошибок
        item.classList.remove("form__input_type_error");
        return !(item.value.trim().length);
    });

    // Если нашлись поля, которые не заполнены, то возвращаем false и помечаем как ошибочные
    if(emptyFields.length) {

        emptyFields.forEach((item) => {
            item.classList.add("form__input_type_error");
        });

        return false;
    }

    return true;

}

/**
 * Обработчик отправки формы
 */
form.addEventListener("submit", (e) => {
    e.preventDefault();

    // Сама форма
    const _thisForm = e.target;

    // Обязательные поля
    const [name, phone, comment, to] = [
        _thisForm.elements.name,
        _thisForm.elements.phone,
        _thisForm.elements.comment,
        _thisForm.elements.to
    ];

    const isValidForm = validateForm(name, phone, comment, to);

    // Если есть какие-то не заполенные поля, то останавляеваем выполнение обработчика
    if(!isValidForm) return;

    // Отправка запроса на сервер
    const promise = new Promise((resolve, reject) => {
        // Объект для передачи полей формы
        const data = {
            name: name.value,
            phone: phone.value,
            comment: comment.value,
            to: to.value,
        };

        const xhr = new XMLHttpRequest();
        xhr.open("POST", "https://webdev-api.loftschool.com/sendmail");
        xhr.setRequestHeader('content-type', 'application/json');
        xhr.responseType = "json";
        xhr.send(JSON.stringify(data));

        xhr.addEventListener("load", (e) => {
            const response = xhr.response;
            if(response.status) {
               resolve(response);
            } else {
               reject(response);
            }
        });
    });

    promise.then((response) => {
        modalText.innerText = response.message;
    });

    promise.catch((response) => {
        modalText.innerText = response.message;
    });

    promise.finally(() => {
        toggleModal();
    });

});


/**
 * Обработчик кнопки для удаление ошибочных полей
 */
reset.addEventListener("click", (e) => {
    const fields = [...form.elements];

    fields.forEach((item) => {
        item.classList.remove("form__input_type_error");
    });
});


// Нужные константы
const wrapper = document.querySelector(".wrapper");
const section = document.querySelectorAll("section");
const display = document.querySelector(".maincontent");
const sideMenu = document.querySelector(".fixed-menu");
const sideMenuItems = sideMenu.querySelectorAll(".fixed-menu__item");
const mobileDetect = new MobileDetect(window.navigator.userAgent);
const isMobile = mobileDetect.mobile();
const scrollLink = document.querySelectorAll(`[data-scroll-to]`);
let inScroll = false;

// Добавляем первой секции активный класс
section[0].classList.add("active");

/**
 * Функция расчета позиции смещения
 * @param sectionIndex
 * @returns {number}
 */
const countSectionPosition = sectionIndex => {
    const position = sectionIndex * -100;

    if (isNaN(position)) {
        console.error("Не число !!");
        return 0;
    }

    return sectionIndex * -100;
};

/**
 * Функция смены класса на фиксированном меню
 * @param itemIndex
 * @param activeClass
 */
const resetActiveClass = (itemIndex, activeClass) => {
    sideMenuItems.forEach((item, index) => {
        item.classList.remove(activeClass);

        if (index === itemIndex)
            item.classList.add(activeClass);
    });
}

/**
 * Функция смены темы фиксированного меню
 * @param sectionIndex
 */
const changeMenuTheme = sectionIndex => {
    const curSection = section[sectionIndex];
    const menuTheme = curSection.dataset.switherTheme;
    const themeClass = "fixed-menu_theme--dark";

    if (menuTheme === "black") {
        sideMenu.classList.add(themeClass);
    } else {
        sideMenu.classList.remove(themeClass);
    }
};

/**
 * Обработка событий на навигационные элементы
 */
scrollLink.forEach((item) => {
    item.addEventListener('click', (e) => {
        e.preventDefault();

        const _this = e.currentTarget;
        const target = _this.dataset.scrollTo;
        const reqSection = document.querySelector(`[data-section-id=${target}]`);
        const index = [...section].indexOf(reqSection);

        performTransition(index);
    });
})


/**
 * Основная функция сдвига к нужному блоку
 * @param sectionIndex
 */
const performTransition = sectionIndex => {
    if (inScroll) return;

    const transitionOver = 1000;
    const mouseInertiaOver = 300;

    inScroll = true;
    const position = countSectionPosition(sectionIndex);

    display.style.transform = `translateY(${position}%)`;

    section.forEach((item) => {
        item.classList.remove('active');
    });

    section[sectionIndex].classList.add("active");

    changeMenuTheme(sectionIndex);

    setTimeout(() => {
        inScroll = false;
        resetActiveClass(sectionIndex, "fixed-menu__item_active");
    }, transitionOver + mouseInertiaOver);

};

/**
 * Метод возвращает функции для направления сдвига
 * @returns {{next(): void, prev(): void}}
 */
const viewportScroller = () => {

    const activeSection = {};

    section.forEach((item, index) => {
        if (item.classList.contains("active")) {
            activeSection.element = item;
            activeSection.index = index;
        }
    });

    const nextSection = activeSection.element.nextElementSibling;
    const prevSection = activeSection.element.previousElementSibling;

    return {
        next() {
            if (nextSection) {
                performTransition(activeSection.index + 1);
            }
        },
        prev() {
            if (prevSection) {
                performTransition(activeSection.index - 1);
            }
        }
    };
}

/**
 * Обработка события скролла колесом
 */
window.addEventListener("wheel", (e) => {
    const deltaY = e.deltaY;
    const scroller = viewportScroller();

    if (deltaY > 0) {
        scroller.next();
    }

    if (deltaY < 0) {
        scroller.prev();
    }
});

/**
 * Обработка события нажатия на кнопки вверх и вниз
 */
window.addEventListener("keydown", (e) => {
    const tagName = e.target.tagName.toLowerCase();
    const userTypingInInputs = tagName === "input" || tagName === "textarea";
    if (userTypingInInputs) return;

    const scroller = viewportScroller();

    switch (e.keyCode) {
        case 38:
            scroller.prev();
            break;
        case 40:
            scroller.next();
            break;
    }
});

/**
 * Скролл на мобильниках
 */
if(isMobile) {

    // Запрещаем событие на мобильниках
    wrapper.addEventListener("touchmove", e => e.preventDefault());

    $(function () {
        $("body").swipe({
            //Generic swipe handler for all directions
            swipe: function (event, direction) {
                const scroller = viewportScroller();
                let scrollDirection = null;

                if(direction === "up") scrollDirection = "next";
                if(direction === "down") scrollDirection = "prev";
                scroller[scrollDirection]();

            }
        });
    });
}




let interval;

const player = {
    parent: document.querySelector(".player"),
    video: document.querySelector("#player"),
    playBtn: document.querySelector(".controls__play"),
    volumeBtn: document.querySelector(".controls__volume"),
    layerBtn : document.querySelector(".player__layer"),
    progressBar: document.querySelector(`input[name=range]`),
    volumeBar: document.querySelector(`input[name=volume]`),
    lastVolume: 1,
    play() {
        this.video.play();
        this.parent.classList.add("played");
    },
    pause() {
        this.video.pause();
        this.parent.classList.remove("played");
    },
    togglePlayer() {
        if(interval) clearInterval(interval);

        this.durationSec = this.video.duration;
        this.progressBar.max = parseInt(this.durationSec);

        if( this.video.paused ) {
            this.play();
            interval = setInterval(() => {
                this.changeProgress();

                if(this.video.ended) {
                    this.pause();
                    this.progressBar.value = 0;
                    clearInterval(interval);
                }

            } ,1000);
        } else {
            this.pause();
        }
    },
    changeProgress() {
        const curTime = parseInt(this.video.currentTime);
        const value = parseInt(this.progressBar.value) + 1;
        this.progressBar.value = value;
    },
    seekTo() {
        this.video.currentTime = this.progressBar.value;
    },
    toggleVolume() {
        if(player.video.volume > 0) {
            this.lastVolume = this.volumeBar.value;
            this.volumeBar.value = 0;
        } else {
            this.volumeBar.value = this.lastVolume;
        }

        this.changeVolume();
        this.changeIcon();

    },
    changeVolume() {
        const curVolume = parseFloat(this.volumeBar.value);
        player.video.volume = curVolume;
        this.changeIcon();
    },
    changeIcon() {
        if(player.video.volume > 0) {
            this.volumeBtn.classList.remove("muted");
        } else {
            this.volumeBtn.classList.add("muted");
        }
    }
};


// Обработчики событий
player.playBtn.addEventListener("click", (e) => {
    e.preventDefault();
    player.togglePlayer();
});

player.layerBtn.addEventListener("click", (e) => {
    e.preventDefault();
    player.togglePlayer();
});

player.progressBar.addEventListener("change", (e) => {
    player.seekTo();
});

player.volumeBtn.addEventListener("click", (e) => {
    e.preventDefault();
    player.toggleVolume();
});

player.volumeBar.addEventListener("change", (e) => {
    player.changeVolume();
});






const items = document.querySelectorAll(".product__link");
const close = document.querySelectorAll(".product__close");

/**
 * Функция расчета ширины
 * @param item
 * @returns {number}
 */
const mesureWidth = item => {
    const screenWidth = $(window).width();
    const itemWidth = item.offsetWidth;
    const itemsWidth = itemWidth * items.length;

    const isTablet= window.matchMedia("(max-width: 768px)").matches;
    const isMobile= window.matchMedia("(max-width: 480px)").matches;

    if(isTablet) {
        if(isMobile)
            return screenWidth - itemWidth;
        return  screenWidth - itemsWidth;
    } else {
        return  500;
    }
};

/**
 * Функция для скрытия всех элементов
 */
const hideEveryItems = () => {
    items.forEach((item) => {
        const container = item.parentElement;
        const content = container.querySelector(".product__content");

        container.classList.remove("active");
        content.style.width = 0;
    });
};

/**
 * Основной метод для открытия и закрытия пунктов
 * @param item
 */
const changeItemAcco = (item) => {
    const container = item.parentElement;
    const content = container.querySelector(".product__content");
    const textContainer = container.querySelector(".product__text");

    if(container.classList.contains("active")) {
        container.classList.toggle("active")
        content.style.width = 0;
    } else {
        hideEveryItems();
        container.classList.toggle("active")

        content.style.width = mesureWidth(item) + "px";
        textContainer.style.width = mesureWidth(item) + "px";
    }
};


/**
 * Навешиваем события на клик по пунктам
 */
if(items.length) {
    items.forEach((item) => {
        item.addEventListener("click", (e) => {
            e.preventDefault();

            const curItem = e.currentTarget;
            changeItemAcco(curItem);
        });
    });
}

/**
 * Навешиваем события на клик закрывающему крестику
 */
if(close.length) {
    close.forEach((item) => {
        item.addEventListener("click", (e) => {
            e.preventDefault();

            hideEveryItems();
        });
    });
}

const setPosItemForMobile = () => {
    let items = document.querySelectorAll(".product__link");
    const isMobile= window.matchMedia("(max-width: 480px)").matches;

    items = [...items].reverse();

    items.forEach((item, index) => {
        if(isMobile) {
            const position = index * -100;
            item.style.transform = 'translateX(' + position + '%)';
        } else {
            item.style.transform = 'translateX(0)';
        }
        

    });
}

setPosItemForMobile();
